export const getEvents = (location) => {
    var myHeaders = new Headers({
        "Access-Control-Allow-Origin": "*"
    });
    myHeaders.append("Access-Control-Allow-Origin", "*");
    return fetch("http://api.eventful.com/json/events/search?app_key=HkgwXkPs5xHpDpR2&location="+location, {
        method: "GET",
        headers: myHeaders
    }).then((res) => {
        return res.json();
    }).catch((err) => {
        console.log(err);
    });
}
